import React, { Component } from 'react';
import "./index.css";

const listStyle = {
  marginLeft: "50px"
};

class About extends Component {
  render() {
    return (
      <div className="aboutDiv">
        <p><span id="break">|&nbsp;</span><span>Theme&nbsp;:</span>&nbsp;"Perseverance"</p>
        <p id="textBody">
          The story of Jesus is sometimes called the greatest love story ever told. Christians who know
          of the love of Christ are called to live a life resembling His. This brings up an important question:
          What is this love story and what does it look like to live in this story? Please join us as we attempt to
          answer this question so that we may learn to love like Christ loved.
        </p>
        <p><span id="break">|&nbsp;</span><span>When&nbsp;:</span>&nbsp;Friday, December 28th to Monday, December 31st 2018</p>
        <p id="textBody">
          <ul style={listStyle}>
            <li>Check-in 3:00pm to 4:00pm</li>
          </ul>
        </p>
      </div>
    )
  };
};

export default About;
